const EditPopup = () => {
  return(
    <fieldset className="popup__set">
      <label className="popup__field">
        <input type="text" className="popup__input" id="popup-name" name="name" placeholder="Имя" minlength="2" maxlength="40" required />
        <span className="popup-name-error popup__input-error"></span>
      </label>

      <label className="popup__field">
        <input type="text" className="popup__input" id="popup-about" name="about" placeholder="О себе" minlength="2" maxlength="200" required />
        <span className="popup-about-error popup__input-error"></span>
      </label>

      <button className="popup__submit-button button" id="popupEdit__submit-button" type="submit" aria-label="Кнопка 'Сохранить'">Сохранить</button>
    </fieldset>
  )
}

export default EditPopup;
